import React from "react";
import { NavLink } from "react-router-dom";


export const Navbar = () => {
  return (
      <div className='navbar'>
      <div className='logo'>
        <img className='logo-class' src={process.env.PUBLIC_URL + '/name_icon.png'} alt='logo'/>
      </div>
      <ul className='navlinks'>
        <li><NavLink className='nav-item' to='/' >Home</NavLink></li>
        <li><NavLink className='nav-item' to='/about' >About</NavLink></li>
        <li><NavLink className='nav-item' to='/projects' >Projects</NavLink></li>
        <NavLink className='nav-item' to='/contact'>Contact</NavLink>
      </ul>
      </div>

  );
};

export default Navbar;
